import React from 'react';
import { IconButton } from '@material-ui/core';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';



const IconCart = ({title}) =>{
   return   <IconButton>
                <ShoppingCartIcon /><br></br>
                <h3> {title} </h3>
             </IconButton>
}
export default IconCart;
